import React from "react";
import { useNavigate } from "react-router-dom";
import styles from "./CstoreMain.module.css";

const CStore = () => {
  const navigate = useNavigate();

  const teens = () => {
    navigate("/teens");
  };
  const comic = () => {
    navigate("/comic");
  };
  const kids = () => {
    navigate("/kids");
  };
  const kodesh = () => {
    navigate("/kodesh");
  };

  return (
    <div>
      <div className={styles.containerc}>
        <div className={styles.imagewrapperc}>
          <img
            src="gg.jpg"
            style={{ height: "180px", width: "180px", fontFamily: "initial" }}
            alt="Logo"
          />
        </div>
        <div className={styles.buttonwrapperc}>
          <button className={styles.buttonc} onClick={teens}>
            Teens
          </button>
          <button className={styles.buttonc} onClick={comic}>
            Comic
          </button>
          <button className={styles.buttonc} onClick={kids}>
            Kids
          </button>
          <button className={styles.buttonc} onClick={kodesh}>
            Kodesh
          </button>
        </div>
      </div>
    </div>
  
  );
};

export default CStore;
